schemaDefinition: "create or replace view PA_RULES_CUBE(\n\t\"Type\",\n\t\"Criteria\"\
  ,\n\t\"PerUnitPoints\",\n\t\"Cap\",\n\t\"MinRequirements\",\n\t\"Market\",\n\t\"\
  LowerLimit\",\n\t\"UpperLimit\",\n\t\"Multiplier\",\n\t\"EffectiveDate\",\n\t\"\
  ExpiryDate\",\n\t\"Tier\",\n\tETL_EXTRACT_DATE,\n\t\"Rules\",\n\t\"PublicSectorMultiplier\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"Type\" as \"Type\",\n       \"Criteria\"\
  \ as \"Criteria\",\n       SUM(\"PerUnitPoints\") as \"PerUnitPoints\",\n      \
  \ SUM(\"Cap\") as \"Cap\",\n       \"MinRequirements\" as \"MinRequirements\",\n\
  \       \"Market\" as \"Market\",\n       \"LowerLimit\" as \"LowerLimit\",\n  \
  \     \"UpperLimit\" as \"UpperLimit\",\n       SUM(\"Multiplier\") as \"Multiplier\"\
  ,\n       \"EffectiveDate\" as \"EffectiveDate\",\n       \"ExpiryDate\" as \"ExpiryDate\"\
  ,\n       \"Tier\" as \"Tier\",\n       \"ETL_EXTRACT_DATE\" as \"ETL_EXTRACT_DATE\"\
  ,\n       \"Rules\" as \"Rules\",\n       SUM(\"PublicSectorMultiplier\") as \"\
  PublicSectorMultiplier\"\nFROM\n  (SELECT \"Type\" as \"Type\",\n          \"Criteria\"\
  \ as \"Criteria\",\n          \"PerUnitPoints\" as \"PerUnitPoints\",\n        \
  \  \"Cap\" as \"Cap\",\n          \"MinRequirements\" as \"MinRequirements\",\n\
  \          \"Market\" as \"Market\",\n          \"LowerLimit\" as \"LowerLimit\"\
  ,\n          \"UpperLimit\" as \"UpperLimit\",\n          \"Multiplier\" as \"Multiplier\"\
  ,\n          \"EffectiveDate\" as \"EffectiveDate\",\n          \"ExpiryDate\" as\
  \ \"ExpiryDate\",\n          \"Tier\" as \"Tier\",\n          \"ETL_EXTRACT_DATE\"\
  \ as \"ETL_EXTRACT_DATE\",\n          \"Rules\" as \"Rules\",\n          \"PublicSectorMultiplier\"\
  \ as \"PublicSectorMultiplier\"\n   FROM \"RDS\".\"ANAPLAN\".\"RULES\")Projection_1\n\
  GROUP BY \"Type\",\n         \"Criteria\",\n         \"MinRequirements\",\n    \
  \     \"Market\",\n         \"LowerLimit\",\n         \"UpperLimit\",\n        \
  \ \"EffectiveDate\",\n         \"ExpiryDate\",\n         \"Tier\",\n         \"\
  ETL_EXTRACT_DATE\",\n         \"Rules\";"
